import React from 'react';
import '../styles/FeaturedSectionCards.css';

const FeaturedSectionCards = () => {
  const cards = [
    {
      id: 'men',
      title: 'Men',
      image: 'https://images.unsplash.com/photo-1521334884684-d80222895322?auto=format&fit=crop&w=600&q=80',
    },
    {
      id: 'women',
      title: 'Women',
      image: 'https://images.unsplash.com/photo-1508214751196-bcfd4ca60f91?auto=format&fit=crop&w=600&q=80',
    },
    {
      id: 'kids',
      title: 'Kids',
      image: 'https://images.unsplash.com/photo-1508214751196-bcfd4ca60f91?auto=format&fit=crop&w=600&q=80',
    },
  ];

  return (
    <section className="featured-section-cards">
      {cards.map(card => (
        <div className="featured-card" key={card.id}>
          <img src={card.image} alt={card.title} />
          <div className="card-overlay">
            <h2>{card.title}</h2>
          </div>
        </div>
      ))}
    </section>
  );
};

export default FeaturedSectionCards;
